import React, { Component } from "react";
import { 
  MDBNavbar, 
  MDBNavbarBrand, 
  MDBNavbarNav, 
  MDBNavItem, 
  MDBNavLink, 
  MDBNavbarToggler, 
  MDBCollapse, 
  MDBDropdown, 
  MDBDropdownToggle, 
  MDBDropdownMenu, 
  MDBDropdownItem, 
  MDBIcon, 
  MDBContainer,
  MDBRow,
  MDBCol
} from "mdbreact";
import { BrowserRouter as Router, Route} from 'react-router-dom'
import Contenedor from "./componentes/Vuelos"

class App extends Component {

  render() {
    return (
      <MDBContainer fluid>
        <Contenedor />
      </MDBContainer>
    );
  }
}

export default App;
